const SignupForm = () => {
    return (
      <>
        <h1>Subscribe!</h1>
        <Formik

        >
          {({ setFieldValue, setFieldTouched, values, errors, touched }) => (
            <Form>
              <MyTextInput
                label="First Name"
                name="firstName"
                errors={errors}
                touched={touched}
                value={values.firstName}
                onChange={setFieldValue}
                onBlur={setFieldTouched}
                placeholder="Jane"
              />
              <MyTextInput
                label="Last Name"
                name="lastName"
                type="text"
                placeholder="Doe"
              />
              <MyTextInput
                label="Email Address"
                name="email"
                type="email"
                placeholder="jane@formik.com"
              />
              <button type="submit">Submit</button>
            </Form>
          )}
        </Formik>
      </>
    );
  };
